import React, { useState,useEffect } from "react";
import myData from "../data.json";




const Idahodata = () => {
    const productlist = myData.IdahoproList
    console.log(productlist.yearlyvariations.id)
        return (
            <ul>
              {productlist.map(dataIn => (
                <li key={dataIn.id}>{dataIn.name}</li>
              ))}
            </ul>
         
